# Luisian algorithm to calculate area
def calculate_area_and_centroid(points)
	n = points.size.to_i
	area_sum = 0.0; cx_sum = 0.0; cy_sum = 0.0

	for i in 0..n-1
	  x0 = points[i%n][0]
	  y1 = points[(i+1)%n][1]
	  x1 = points[(i+1)%n][0]
	  y0 = points[i%n][1]

	  factor = x0*y1 - x1*y0
	  area_sum += factor
	  cx_sum   += factor * (x0 + x1)
	  cy_sum   += factor * (y0 + y1)
	end

	if points.size > 1
	  factor = 3 * area_sum

	  cx_sum /= factor
	  cy_sum /= factor
	else
	  cx_sum, cy_sum = points.first
	end
	area_sum *= 0.5

	area = (111*90*area_sum).abs
	centroid = [cx_sum, cy_sum]

	return area
end

# Method to calculate distance between points
# * update with a more geographically correct version
def distance(x,y)
	return Math.sqrt((x[0]-y[0])**2 + (x[1]-y[1])**2)
end

